import React from 'react';
import './modal.css';

class Modal extends React.Component {
    render() {
        return (
            <div className="modalContainer">
                <div className="content">
                    <form>
                        <h1 class="modalContainerHeading">Signup</h1>
                        <input type="text" placeholder="Username" id="un" name="un" />
                        <input type="text" placeholder="Full Name" id="fname" name="fname" />
                        <input type="text" placeholder="Email" id="em" name="em" />
                        <input type="text" placeholder="Contact Number" id="pno" name="pno" />
                        <input type="password" placeholder="Password" id="pas" name="pas" />
                        <input type="password" placeholder="Confirm Password" id="cp" name="cp" />
                        <input type="submit" placeholder="Sign-Up" />
                    </form>
                </div>
            </div>
                // <div className="modal12333">
                //     <div className="header"> Modal Title </div>
                //     <div className="content">
